var bloodhoundSpecies = new Bloodhound({
    datumTokenizer: Bloodhound.tokenizers.obj.whitespace('value'),
    queryTokenizer: Bloodhound.tokenizers.whitespace,
    local: $.map(my_data.species, function(species) { return {value: species}; })
});
var bloodhoundAA = new Bloodhound({
    datumTokenizer: Bloodhound.tokenizers.obj.whitespace('value'),
    queryTokenizer: Bloodhound.tokenizers.whitespace,
    local: $.map(my_data.aa, function(species) { return {value: species}; })
});
var bloodhoundSub = new Bloodhound({
    datumTokenizer: Bloodhound.tokenizers.obj.whitespace('value'),
    queryTokenizer: Bloodhound.tokenizers.whitespace,
    local: $.map(my_data.substitution, function(species) { return {value: species}; })
});

function loadExample(index, showImage) {
    $.each($.extend(examples['base'].values, examples[index].values), function(id, value) {
        $('#' + id).val(value);
    });

    $.each($.extend(examples['base'].radio, examples[index].radio), function(id, value) {
        $('#' + id + '-' + value).prop('checked', true);
    });

    $('#visualisation-' + examples[index].radio.visualisation).trigger('change');

    if (showImage) {
        $('#logoImage').prop('src', '/images/logo/example' + index + '.jpeg').removeClass('hidden');
        window.scrollTo(0, 200);
    }
}

function checkExample() {
    var lUrl = document.location.toString();
    var lExampleIndex = lUrl.indexOf('example=');

    if (lExampleIndex != -1) {
        loadExample(lUrl.substr(lExampleIndex + 8, lExampleIndex + 9), true);
    }
}

/**
 * Check that sequence set is provided all sequences are the same length
 * @param sequencesToCheck List of AA sequences
 * @param setType The type of set to check (experimental or reference)
 * @returns {boolean} If input is valid
 */
function checkSequences(sequencesToCheck, setType) {
    var sequenceArray = sequencesToCheck.trim().split('\n');
    var seqLength = sequenceArray[0].trim().length;
    var seqCount = sequenceArray.length;

    if (seqCount === 0 || seqLength === 0) {
        alert('You did not give a ' + setType + ' sequence set');
        return false;
    }

    for (var i = 0; i < seqCount; i ++) {
        if (sequenceArray[i].length != 0 && sequenceArray[i].trim().length != seqLength) {
            alert(sequenceArray[i] + ' (at line ' + (i + 1) + '/' +  seqCount + ' ) of the ' + setType + ' set is not ' + seqLength + ' amino acids long');
            return false;
        }
    }

    return true;
}

/**
 * Validate the form contents
 * @returns {boolean} If form is valid
 */
function validateForm() {
    if (!checkSequences($('#positiveSequences').val(), 'experimental')) {
        return false;
    }

    var reference = $('input[name="reference"]:checked').val();

    if (reference == 'swiss-prot' && $.inArray($('#species').val(), my_data.species) === -1) {
        alert('Please specify a valid species from the list');
        return false;
    } else if (reference == 'reference_set' && !checkSequences($('#negativeSequences').val(), 'reference')) {
        return false;
    }

    if (!$.isNumeric($('#start').val())) {
        alert('A numeric start position is required');
        return false;
    }

    var pValue = $('#pValue').val();

    if (!$.isNumeric(pValue) || pValue <= 0 || pValue >= 1) {
        alert('P value must be a number between 0 and 1');
        return false;
    }

    if (!$.isNumeric($('#height').val()) || !$.isNumeric($('#width').val())) {
        alert('A numeric height and width value are required');
        return false;
    }

    var visualisationType = $('input[name="visualisation_type"]:checked').val();

    if (visualisationType == 'aaMatrix' && $.inArray($('#species').val(), my_data.aa) === -1) {
        alert('Please specify a valid amino acid parameter matrix from the list');
        return false;
    } else if (visualisationType == 'substitutionMatrix' && $.inArray($('#substitutionMatrix').val(), my_data.substitution) === -1) {
        alert('Please specify a valid amino acid parameter matrix from the list');
        return false;
    }

    return true;
}

$(function() {
    $('#load_sample_data').click(function () {
        loadExample(1, false);
        return false;
    });

    $('input[name="visualisationType"]').change(function() {
        var $this = $(this);

        $this.parents('.form-group')
            .find('.form-control')
            .addClass('hidden')
            .prop('disabled', true);

        $this.parents('.form-group').find('.pull-right').addClass('hidden');

        if ($this.val() === 'aaParameter' || $this.val() === 'correlationLine') {
            $this.parents('.radio').find('.form-control').prop('disabled', false).removeClass('hidden');
            $this.parents('.radio').find('.pull-right').removeClass('hidden');

            $('#scoringSystem').addClass('hidden');
        } else if ($this.val() === 'iceLogo') {
            $('#scoringSystem').removeClass('hidden');
        } else {
            $('#scoringSystem').addClass('hidden');
        }
    });

    bloodhoundSpecies.initialize();
    bloodhoundAA.initialize();
    bloodhoundSub.initialize();

    $('#species').typeahead({
        minLength: 0,
        highlight: true,
        hint: true
    }, {
        displayKey: 'value',
        name: 'species',
        source: bloodhoundSpecies.ttAdapter()
    });

    $('#aaMatrix').typeahead({
        minLength: 0,
        highlight: true,
        hint: true
    }, {
        displayKey: 'value',
        name: 'AA',
        source: bloodhoundAA.ttAdapter()
    });

    $('#substitutionMatrix').typeahead({
        minLength: 0,
        highlight: true,
        hint: true
    }, {
        displayKey: 'value',
        name: 'substitution',
        source: bloodhoundSub.ttAdapter()
    });

    $('.input-list').on('click', 'a', function() {
        $('#' + $(this).parents('ul').data('target')).val($(this).text());
        $(this).parents('.modal').modal('hide');

        return false;
    });

    $('label').popover();

    $('.colorselector').colorselector();

    $('#logoForm').submit(function() {
        if (validateForm()) {
            $('#makeLogo').attr('disabled', true).html('<img src="/images/ajax-loader.gif">');

            var $this = $(this);

            $.ajax({
                url: $this.attr('action'),
                data: $this.serialize(),
                dataType: 'text',
                timeout: 10000,
                method:'POST'
            }).done(function(response){
                $('#logoImage').attr('src', '/generated_images/' + response + '.jpeg')
                    .data('current', response)
                    .removeClass('hidden');

                $('#saveDropdown').removeClass('hidden');

                window.scrollTo(0, 200);

                $('#makeLogo').attr('disabled', false).html('Generate');
            }).fail(function(response) {
                alert('An error occurred communicating with the server. Please try again.');
                $('#makeLogo').attr('disabled', false).html('Generate');
            });

        }

        return false;
    });

    $('#preset_list').change(function() {
        var $this = $(this);

        $.post('/data/colors', {preset: $this.val()}, function(response) {
            var $pickers = $('.colorselector');

            var i = 0;
            var splittedResponse = response.split(",");
            $pickers.each(function(){

                $(this).colorselector('setColor',splittedResponse[i]);
                i++;
            });

        });
    });

    $('.pagination').on('click', 'li a', function() {
        $('.textblock').addClass('hidden');
        $('.pagination li').removeClass('active');
        $(this.parentNode).addClass('active');
        $($(this).attr('href')).removeClass('hidden');
        return false;
    });

    $('.visualisation-sublist').on('click', 'li a', function() {
        $($(this).attr("href") + " a").trigger("click");
    });

    $('#saveAs li a').click(function() {
        var url = '/generated_images/' + $('#logoImage').data('current') + $(this).data('extension');

        window.open(url, '_blank');

        return false;
    });

    checkExample();

    $('#preset_list').val('Standard').trigger('change');
});